function TeamForm(props) {
    const teamsForm = props.matchData?.content?.matchFacts?.teamForm
    console.log(teamsForm)
    return (
        <div className="w-full rounded-lg bg-gray-100 p-4 flex gap-3 justify-between">
            <div className="">
                {teamsForm?.map((matches, index) => (
                    <div key={index} className="flex flex-col gap-2 items-center">
                        {matches?.map((match, index) => (
                            <div key={index} className="flex gap-2 items-center">
                                <img className="h-5 w-5" src={`https://images.fotmob.com/image_resources/logo/teamlogo/${match?.home.id}.png`} alt="team1Logo"></img>
                                <img className="h-5 w-5" src={`https://images.fotmob.com/image_resources/logo/teamlogo/${match?.away.id}.png`} alt="team1Logo"></img>
                            </div>
                        ))}
                    </div>
                ))}
            </div>
        </div>
    )
} 

export default TeamForm
